fields.description:
Гимнастические накладки для работы на перекладине.
Изготовлены из высококачественной натуральной кожи. Толщина кожи варьируется в зависимости от размера накладок
Пластиковый валик, диаметр ок 10 мм, закрепленный леской 1,0 мм, легко демонтируемый при необходимости.

Для определения размера измеряется кисть руки от запястья до середины среднего пальца. Если измерения попали между размерами, выбирается ближайший размер
00 – до 10 см ;
0 - 11 см; 
1 –12 см
2 – 13,1 см; 
3 - 14,3 см; 
4 - 15,5 см;
 5 - 16,7 см.
